userDefinedLinkHintCss:
/* gruvbox material palette */

:root {
  --bgDim: #141617;
  --bg0: #1d2021;
  --bg1: #282828;
  --bg2: #3c3836;
  --bg3: #504945;
  --grey0: #7c6f64;
  --grey1: #928374;
  --grey2: #a89984;
  --fg0: #d4be98;
  --fg1: #ddc7a1;
  --red: #ea6962;
  --orange: #e78a4e;
  --yellow: #d8a657;
  --green: #a9b665;
  --aqua: #89b482;
  --blue: #7daea3;
  --purple: #d3869b;
  --redDim: #3c1f1e;
  --greenDim: #32361a;
  --blueDim: #0d3138;
  --redBg: #442e2d;
  --yellowBg: #473c29;
  --greenBg: #333e34;
  --blueBg: #2e3b3b;
}

#vimiumHintMarkerContainer div.internalVimiumHintMarker, #vimiumHintMarkerContainer div.vimiumHintMarker {
  padding: 2px 4px;
  border-radius: 2px;
  background: var(--bg0);
  border: 0;
  border-color: var(--green);
  box-shadow: none;
}

#vimiumHintMarkerContainer div span {
  color: var(--fg0);
  text-shadow: none;
}

#vimiumHintMarkerContainer div > .matchingCharacter {
  opacity: 1.0;
  color: var(--grey0);
}

#vimiumHintMarkerContainer div > .matchingCharacter ~ span {
  color: var(--fg0);
}

#vomnibar {
  background: var(--bg0);
  border: 0px solid var(--green);
  border-radius: 2px;
  animation: show 200ms cubic-bezier(0, 0, 0.2, 1) forwards;
  max-height: calc(100vh - 70px);
  overflow: hidden;
}

@keyframes show {
  0% {
    transform: translateY(50px);
    opacity: 0;
  }
  100% {
    transform: translateY(0);
    opacity: 1;
  }
}

#vomnibar input {
  color: var(--fg0);
  background: var(--bg0);
  border: none;
  height: unset;
  padding: 16px 30px;
  border-radius: 2px;
}

#vomnibar .vomnibarSearchArea {
  border: none;
  padding: unset;
  background: var(--bg0)
}

#vomnibar ul {
  padding: 10px;
  margin: 0;
  background: var(--bg0);
}

#vomnibar li {
  padding: 10px;
  /* border: 1px solid var(--purple); */
  border-bottom: none;
}

#vomnibar li .vomnibarTopHalf,
#vomnibar li .vomnibarBottomHalf {
  padding: 3px 0;
}

#vomnibar li .vomnibarSource {
  color: var(--yellow);
}

#vomnibar li em,
#vomnibar li .vomnibarTitle {
  color: var(--fg0);
}

#vomnibar li .vomnibarUrl {
  color: var(--fg0);
}

#vomnibar li .vomnibarMatch {
  color: var(--grey0);
}

#vomnibar li .vomnibarTitle .vomnibarMatch {
  color: var(--blue);
}

#vomnibar li.vomnibarSelected {
  background-color: var(--bg1);
}

div.vimiumHUD {
  background: var(--bg0);
  border: 0px solid var(--green);
  box-shadow: none;
}

div.vimiumHUD span#hud-find-input,
div.vimiumHUD .vimiumHUDSearchAreaInner {
  color: var(--fg0)
}

div.vimiumHUD .hud-find {
  background-color: var(--bg0);
  border: none;
}

div.vimiumHUD .vimiumHUDSearchArea {
  background-color: var(--bg0);
}
